import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate, useParams } from "react-router-dom";
import PanelCard from "../../PanelCard";
import { FaPaw, FaUserEdit, FaClipboardList, FaBell, FaDog } from "react-icons/fa";
import { Mail, Phone, MapPin, User, BriefcaseMedical } from "lucide-react";
import "./DistributorPanel.css";

const DistributorPanel = () => {
  const navigate = useNavigate();
  const { userID } = useParams(); // Get distributor ID (userID) from URL params
  const [distributorProfile, setDistributorProfile] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchDistributorProfile = async () => {
      try {
        const response = await axios.get(`http://localhost:8800/api/distributorPanel/get/${userID}`);
        if (response.data.length === 0) {
          setDistributorProfile(null);  // If no profile found
        } else {
          setDistributorProfile(response.data[0]);  // Assuming data is an array, take the first item
        }
      } catch (error) {
        console.error("Error fetching distributor profile:", error);
        setDistributorProfile(null); // In case of error
      } finally {
        setLoading(false);
      }
    };

    if (userID) {
      fetchDistributorProfile();
    }
  }, [userID]);

  return (
    <div className="distributorPanel-section">
      <h1>Distributor Management Panel</h1>
      <p>Manage your distributor journey seamlessly.</p>

      <div className="distributorPanel-content">
        <div className="distributor-card-container">
          <div className="distributor-card">
            <div className="distributoravatar">
              <User size={50} />
            </div>
            <div className="distributordetails">
              {loading ? (
                <p>Loading distributor profile...</p>
              ) : distributorProfile ? (
                <>
                  <h2>{distributorProfile.disName}</h2>
                  <p><BriefcaseMedical size={18} /> <strong>Distributor ID:</strong> {distributorProfile.disID}</p>
                  <p><Mail size={18} /> <strong>User ID:</strong> {distributorProfile.userID}</p>
                  <p><BriefcaseMedical size={18} /> <strong>Email:</strong> {distributorProfile.disEmail}</p>
                  <p><Phone size={18} /> <strong>Phone:</strong> {distributorProfile.disPhone}</p>
                  <p><MapPin size={18} /> <strong>Location:</strong> {distributorProfile.disLocation}</p>
                </>
              ) : (
                <p>No distributor profile available for this user.</p>
              )}
            </div>
          </div>
        </div>

        {/* Panel Cards for Navigation */}
        <PanelCard
          icon={<FaUserEdit size={50} color="#fff" />}
          title="Manage Profile"
          description="Update your distributor profile."
          onClick={() => navigate(`/distributorProfile/${userID}`)}  // Navigate to profile management page
        />

        <PanelCard
          icon={<FaPaw size={50} color="#fff" />}
          title="Pet Management"
          description="Register your pets for adoption."
          onClick={() => navigate("/manageMyPets")}
        />

        <PanelCard
          icon={<FaDog size={50} color="#fff" />}
          title="My Pets"
          description="Stay updated with your all pets."
          onClick={() => navigate("/MyPets")}
        />

        <PanelCard
          icon={<FaBell size={50} color="#fff" />}
          title="Adoption Requests Notifications"
          description="Check your pet adoption requests."
          onClick={() => navigate("/adoptionRequests")}
        />

        <PanelCard
          icon={<FaClipboardList size={50} color="#fff" />}
          title="Vet Booking Status"
          description="Stay updated with your vet bookings."
          onClick={() => navigate("/vetBookingStatus")}
        />

        <PanelCard
          icon={<FaClipboardList size={50} color="#fff" />}
          title="Daycare Booking Status"
          description="Stay updated with your daycare bookings."
          onClick={() => navigate("/daycareBookingStatus")}
        />
      </div>
    </div>
  );
};

export default DistributorPanel;
